graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Data Transform</b></font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="logLevel__key" align="left" balign="left">logLevel</td><td port="logLevel__value" align="left" balign="left">info</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "DataStore" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>DataStore</b> <i>&lt;context&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="rawData__key" align="left" balign="left">rawData</td><td port="rawData__value" align="left" balign="left">[]</td></tr><tr><td port="processedData__key" align="left" balign="left">processedData</td><td port="processedData__value" align="left" balign="left">[]</td></tr></table></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];
  "Fetch" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Fetch</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Fetch raw data</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Transform" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Transform</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Transform data</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Save" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Save</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Save processed data</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "Fetch" -> "Transform" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Transform" -> "Save" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "DataStore" -> "Transform" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Transform" -> "DataStore" [penwidth=3, color="#D32F2F", labelOverlay="75%", labelhref="#srcLineTBD"];
}
